import React, { Component } from 'react';
import axios from 'axios';
import "./style-sheets/test.css";

const GameName = props => (
  <tr>
    <td>{props.game.name}</td>
  </tr>
)

export default class TestPage extends Component{
  constructor(props) {
    super(props);

   this.state = {games: []};
  }

  componentDidMount() {
    axios.get('http://localhost:5000/gametiles/')
      .then(res => {
        console.log(res.data);
        this.setState({games: res.data})
        console.log(this.state.games[0].name);
      })
      .catch((error) => {
        console.Console.log(error);
      })
  }

  gameList(){
    return this.state.games.map(currentGame =>{
      return <GameName game={currentGame} key={currentGame._id} />
    })
  }

  getGame(){
    return this.state.games[0].name;
  }

  render() {
    return(
      <div className="page">
        <div className="gameTileGrid">
          <h1>{this.getGame()}</h1>
        </div>
        <h1>Games: {this.gameList()}</h1>
      </div>
    );
  }
}
